import React from "react";

import { ExamplePreview } from "components/ExamplePreview";
import * as Section from "components/PageSection";

import previewImg from "./assets/navbar.png";

export const Task2 = () => (
  <Section.Wrapper>
    <Section.Content>
      <Section.Header>
        <Section.Title>Task #2</Section.Title>
        <Section.Description>
          Lorem ipsum dolor sit amet, consectetur adipisicing elit. Dignissimos
          nostrum vel, amet sed qui impedit voluptate natus beatae animi labore
          at, perspiciatis nihil rerum ullam excepturi aliquam magnam ex.
          Tempore.
        </Section.Description>
        <ExamplePreview src={previewImg} />
        <Section.Description>
          It should consist of two items - <span>Start</span> and{" "}
          <span>My Profile</span>, and be located in the top-right corner.
        </Section.Description>
      </Section.Header>
    </Section.Content>
  </Section.Wrapper>
);
